// Home.js
import React from 'react';
import '@fortawesome/fontawesome-free/css/all.min.css';

function Home() {
    return (
        <div className="min-h-screen bg-white">
            <Header />
            <MainContent />
        </div>
    );
}

function Header() {
    return (
        <header className="bg-blue-600 text-white p-4 flex justify-between items-center">
            <nav className="space-x-4">
                <a href="#" className="hover:underline">Home</a>
                <a href="#" className="hover:underline">About Us</a>
                <a href="#" className="hover:underline">Refresh</a>
                <a href="#" className="hover:underline">Performance</a>
                <a href="#" className="hover:underline">Report Bug</a>
            </nav>
            <i className="fas fa-sign-out-alt"></i>
        </header>
    );
}

function MainContent() {
    return (
        <main className="p-4">
            <UserInfo />
            <TaggingSection />
            <TagList />
        </main>
    );
}

function UserInfo() {
    return (
        <div className="bg-gray-100 p-4 rounded shadow-md mb-4">
            <p className="font-bold">Current User: Siaesh Gaonkar</p>
        </div>
    );
}

function TaggingSection() {
    return (
        <div className="border p-4 rounded shadow-md mb-4">
            <div className="flex justify-between mb-4">
                <div>
                    <label className="font-bold mr-2">Language:</label>
                    <select className="border rounded p-1">
                        <option>Konkani</option>
                    </select>
                </div>
                <div>
                    <label className="font-bold mr-2">Method:</label>
                    <select className="border rounded p-1">
                        <option>CLIFT NER</option>
                    </select>
                </div>
            </div>
            <div className="grid grid-cols-2 gap-4 mb-4">
                <textarea className="border rounded p-2 w-full h-40"></textarea>
                <textarea className="border rounded p-2 w-full h-40"></textarea>
            </div>
            <div className="flex space-x-2">
                <button className="border rounded px-4 py-2">Clear Tag</button>
                <button className="border rounded px-4 py-2">Preview</button>
                <button className="border rounded px-4 py-2">Next</button>
                <button className="bg-green-500 text-white rounded px-4 py-2">Tag Sentence</button>
                <button className="bg-blue-500 text-white rounded px-4 py-2">Save</button>
            </div>
        </div>
    );
}

function TagList() {
    const tags = [
        { text: 'Person', color: 'bg-green-300' },
        { text: 'Noun', color: 'bg-blue-300' },
        { text: 'Festival', color: 'bg-orange-300' },
        { text: 'Language', color: 'bg-red-300' },
        { text: 'Religion', color: 'bg-teal-300' },
        { text: 'Game', color: 'bg-yellow-300' },
        { text: 'Doubt', color: 'bg-yellow-100' },
        { text: 'Literature', color: 'bg-purple-700 text-white' },
        { text: 'B-Person', color: 'bg-yellow-400' },
        { text: 'B-Noun', color: 'bg-blue-400' },
        { text: 'B-Festival', color: 'bg-orange-400' },
        { text: 'B-Language', color: 'bg-red-400' },
        { text: 'B-Religion', color: 'bg-teal-400' },
        { text: 'B-Game', color: 'bg-yellow-400' },
    ];

    return (
        <div className="border-t border-b py-4">
            <div className="flex flex-wrap space-x-2">
                {tags.map((tag, index) => (
                    <span key={index} className={`${tag.color} text-black rounded px-2 py-1`}>
                        {tag.text}
                    </span>
                ))}
            </div>
        </div>
    );
}

export default Home;
